import './Head.css';
import REturnLogo from './Logo';
import ReturnPrix from './Prix';
import Media from 'react-media';
import ReturnWallet from './Wallet';
import ReturnSetting from './Setting';

// View head 
export default function ReturnHeAd() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-head-dash'>
  <REturnLogo />

  <div className='wrp-subhead-dash'>
   <ReturnPrix />
   <ReturnWallet />
   <ReturnSetting />
  </div>

 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-head-dash-sm'>
  <REturnLogo />
  <div className='wrp-subhead-dash-sm'>
   <ReturnPrix />
   <ReturnSetting />
  </div>
 </div>
);
